import UserCard from "../components/userCard";

export default function Users({ users }) {
  return (
    <div>
      <div className="py-20">
        {users.map((user) => (
          <UserCard user={user} />
        ))}
      </div>
    </div>
  );
}

Users.getInitialProps = async (context) => {
  try {
    const users = await (
      await fetch("https://jsonplaceholder.typicode.com/users")
    ).json();
    return { users };
  } catch (error) {}
};
